import React from 'react';
import Reviews from '../components/reviews';
import ExternHeader from '../components/ExternHeader';

const ReviewsPage = () => {
    return (
        <div>
            <ExternHeader title="Re" />
            <Reviews home={false} />
        </div>
    );
}

export default ReviewsPage;
